{"id": 3408475, "title": "\u6d59\u6c5f\u5efa\u53cb\u5de5\u7a0b\u54a8\u8be2\u6709\u9650\u516c\u53f8\u5173\u4e8e\u5730\u8d28\u707e\u5bb3\u81ea\u52a8\u5316\u4e13\u4e1a\u76d1\u6d4b\u70b9\u5efa\u8bbe\u7684\u516c\u5f00\u62db\u6807\u516c\u544a", "publish_time": "2018-10-05 18:51:32.0", "content": "<style id=\"fixTableStyle\" type=\"text/css\">table {border-spacing:0}th,td {border:1px solid #DDD;padding: 5px 10px;}</style><div></div><p><br/></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 18px;\">\u4e00\u3001 &nbsp; \u62db\u6807\u9879\u76ee\u7f16\u53f7\uff1a</span></strong><span style=\"font-size: 18px;\">&nbsp;&nbsp;<span class=\"bookmark-item uuid-1536114230642 code-00004\">ZJJY-CG-201806</span>&nbsp;<br/></span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 18px;\">\u4e8c\u3001&nbsp; &nbsp;\u91c7\u8d2d\u7ec4\u7ec7\u7c7b\u578b\uff1a</span></strong><span style=\"font-size: 18px;\">&nbsp;&nbsp;<span class=\"bookmark-item uuid-1536114237662 code-00006\">\u5206\u6563\u91c7\u8d2d-\u5206\u6563\u59d4\u6258\u4e2d\u4ecb</span>&nbsp;</span></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 18px;\">\u4e09\u3001&nbsp; &nbsp;\u62db\u6807\u9879\u76ee\u6982\u51b5</span></strong></p><p>&nbsp;<span class=\"bookmark-item uuid-1536325460878 code-23001\">\n &nbsp;</span></p><table width=\"100%\"><tbody><tr style=\"font-weight:bold;background-color:#f7f7f7\" class=\"firstRow\"><th valign=\"top\">\u6807\u9879\u5e8f\u53f7</th><td valign=\"top\">\u6807\u9879\u540d\u79f0</td><td valign=\"top\">\u6570\u91cf</td><td valign=\"top\">\u9884\u7b97\u91d1\u989d(\u5143)</td><td valign=\"top\">\u5355\u4f4d</td><td valign=\"top\">\u7b80\u8981\u89c4\u683c\u63cf\u8ff0</td><td valign=\"top\">\u5907\u6ce8</td></tr><tr class=\"firstRow\"><th valign=\"top\">1</th><td valign=\"top\">\u5730\u8d28\u707e\u5bb3\u81ea\u52a8\u5316\u4e13\u4e1a\u76d1\u6d4b\u70b9\u5efa\u8bbe\u9879\u76ee</td><td valign=\"top\">1</td><td valign=\"top\">500000</td><td valign=\"